import React from 'react';

import Title from './Title';
import Todos from './Todos';

class App extends React.Component {
  constructor(props){
    super(props);

    this.state = {
      handling: []
    };
  }

  AddTodo = (e, inputinput) => {
    e.preventDefault();
    var joinedState = this.state.handling.concat(inputinput.target.value);
    console.log(inputinput.target.value);
    this.setState({
      handling: joinedState,
    });
  };

  render(){
    return (
      <div className="ui container segment">
        <Title onClick={this.AddTodo}/>
        <Todos handling={this.state.handling}/>
      </div>
    );
  };

}
export default App;
